import Mobile from '../assets/Mobile.jpg';

const Cardtwo = () => {
  return (
    <div className='w-full bg-white py-30 px-4'>
        <div className='w-[80%] mx-auto my-20 bg-white rounded-xl drop-shadow-2xl py-20 px-3'>
      <div className='max-w-[1240px] mx-auto grid md:grid-cols-2'>
        <img className='w-[40%] mx-3 my-3' src={Mobile} alt='/' />
        <div className='flex flex-col justify-center'>
          <h1 className='md:text-2xl sm:text-1xl text-2xl font-bold px-3 py-3'>You can watch my own proyects here</h1>
          <p className='px-3 '>
            Hola
          </p>
          <button className='bg-white text-black w-[200px] rounded-md font-medium my-2 mx-auto md:mx-0 px-3 py-3'>Get Started</button>
        </div>
      </div>
      </div>
    </div>
  );
};

export default Cardtwo;
